import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getDogDetail } from "../../redux/actions/index";
import { useParams } from "react-router-dom";
import DogCard from "../dogCard/DogCard";


const DogDetails = () => {
  const dispatch = useDispatch();
  const { id } = useParams();
  const dogDetail = useSelector((state) => state.dogs.dogDetail);

  useEffect(() => {
    dispatch(getDogDetail(id));
  }, [dispatch, id]);

  return (
    <div>
      {dogDetail ? (
        <DogCard
          id={dogDetail.id}
          name={dogDetail.name}
          image={dogDetail.image}
          temperaments={dogDetail.temperaments}
          weight={dogDetail.weight}
          height={dogDetail.height}
          life_span={dogDetail.life_span}
          origin={dogDetail.origin}
        />
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default DogDetails;
